        this.cookieService = cookieService;
        this.gameService = gameService;
        this.dialog = dialog;
        this.properties = [];
        this.game = new Game();
        this.user = new User();
        this.playerDetails = new PlayerDetails();
    }
    ngOnInit() {
        this.gameService.getProperties().subscribe(response => { this.properties = response.sort((a, b) => (a.id > b.id) ? 1 : -1); });
