        this.gameService.findById(this.game).subscribe(async (response) => {
            this.game = response;
            this.game.players_details = this.game.players_details.sort((a, b) => (a.player_number > b.player_number) ? 1 : -1);
            this.game.players_details.forEach(player => {
                if (player.user_id == this.user.username) {
                    this.playerDetails = player;
                }
                console.log(this.playerDetails.turn);
                if (player.turn) {
                    let turno = document.getElementById('turno');
                    turno.innerHTML = "Turno de " + player.user_id;
                }
            });
            console.log("delay");
            this.mostrarPosiciones();
            await this.delay(1000);
            this.mostrarDatosPartida();
        });
    }
    mostrarPosiciones() {
        for (let i = 0; i <= 27; i++) {
            let box = document.getElementById('ficha' + i);
            box.innerHTML = "";
        }
        this.game.players_details.forEach(player_details => {
            let box = document.getElementById('ficha' + player_details.position);
            box.innerHTML += '<div id="token' + player_details.player_number + '"></div>';
        });
    }
    tirarDados() {
        this.playerDetails.turn = false;
        let dados = document.getElementById('dado');
        dados.style.display = "inline";
        this.gameService.movePlayer(this.playerDetails).subscribe(response => {
            dados.innerHTML = "";
            this.openDialog(response);
        });
    }
    openDialog(property) {
        this.dialog.open(DialogComponent, {
            data: {
                property: property,
                playerDetails: this.playerDetails
            },
            width: '60%',
            height: '80%'
        });
    }
